const CheckBox = (props) => {
    return (
        <Form.Group controlId={props.name}>
            <Form.Label>{props.title}</Form.Label>
            <div className='mb-3'>
              {props.options.map(
                icon => (
                  <Form.Check
                    inline
                    type='checkbox'
                    id={`default-icon ${icon}`}
                    label={icon}
                    onChange={props.handleChange}
                    checked={props.selectedOptions.indexOf(icon) > -1}
                  />
                )
              )}
            </div>
        </Form.Group>
    )
}

export default CheckBox
